import React, { useState } from 'react';
import { View, Text, StyleSheet, TextInput, TouchableOpacity, ScrollView, Alert, ActivityIndicator } from 'react-native';
import { SafeAreaView } from 'react-native-safe-area-context';
import { StatusBar } from 'expo-status-bar';
import { Ionicons } from '@expo/vector-icons';

export default function ApplicationFormScreen({ route, navigation }) {
    const { title, service } = route.params || { title: 'Application', service: 'General' };
    const [loading, setLoading] = useState(false);
    const [formData, setFormData] = useState({
        name: '',
        mobile: '',
        description: ''
    });

    const handleSubmit = async () => {
        if (!formData.name || !formData.mobile) {
            Alert.alert('Missing Information', 'Please fill in all required fields.');
            return;
        }

        setLoading(true);
        // Simulate API call
        setTimeout(() => {
            setLoading(false);
            Alert.alert(
                'Application Submitted',
                `Your ${title} for ${service} has been submitted successfully. Application ID: APP-${Math.floor(Math.random() * 10000)}`,
                [
                    { text: 'OK', onPress: () => navigation.goBack() }
                ]
            );
        }, 1500);
    };

    return (
        <SafeAreaView style={styles.container} edges={['top']}>
            <StatusBar style="dark" />

            {/* Header */}
            <View style={styles.header}>
                <TouchableOpacity onPress={() => navigation.goBack()} style={styles.backButton}>
                    <Ionicons name="arrow-back" size={24} color="#1E293B" />
                </TouchableOpacity>
                <Text style={styles.headerTitle}>{title}</Text>
            </View>

            <ScrollView contentContainerStyle={styles.content}>
                <View style={styles.infoCard}>
                    <Ionicons name="information-circle" size={24} color="#3B82F6" />
                    <Text style={styles.infoText}>
                        You are applying for <Text style={{ fontWeight: 'bold' }}>{title}</Text> under <Text style={{ fontWeight: 'bold' }}>{service}</Text> services. details.
                    </Text>
                </View>

                {/* Simulated Form Fields */}
                <View style={styles.formGroup}>
                    <Text style={styles.label}>Applicant Name <Text style={styles.required}>*</Text></Text>
                    <TextInput
                        style={styles.input}
                        placeholder="Enter full name"
                        value={formData.name}
                        onChangeText={(t) => setFormData({ ...formData, name: t })}
                    />
                </View>

                <View style={styles.formGroup}>
                    <Text style={styles.label}>Mobile Number <Text style={styles.required}>*</Text></Text>
                    <TextInput
                        style={styles.input}
                        placeholder="Enter mobile number"
                        keyboardType="phone-pad"
                        value={formData.mobile}
                        onChangeText={(t) => setFormData({ ...formData, mobile: t })}
                    />
                </View>

                <View style={styles.formGroup}>
                    <Text style={styles.label}>Consumer Number (If applicable)</Text>
                    <TextInput style={styles.input} placeholder="e.g., 1234567890" />
                </View>

                <View style={styles.formGroup}>
                    <Text style={styles.label}>Additional Details</Text>
                    <TextInput
                        style={[styles.input, styles.textArea]}
                        placeholder="Describe your request..."
                        multiline
                        numberOfLines={4}
                        textAlignVertical="top"
                        value={formData.description}
                        onChangeText={(t) => setFormData({ ...formData, description: t })}
                    />
                </View>

                <TouchableOpacity
                    style={[styles.submitButton, loading && styles.disabledButton]}
                    onPress={handleSubmit}
                    disabled={loading}
                >
                    {loading ? (
                        <ActivityIndicator color="#FFF" />
                    ) : (
                        <Text style={styles.submitButtonText}>Submit Application</Text>
                    )}
                </TouchableOpacity>

            </ScrollView>
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#F8FAFC',
    },
    header: {
        flexDirection: 'row',
        alignItems: 'center',
        padding: 20,
        backgroundColor: '#FFFFFF',
        borderBottomWidth: 1,
        borderBottomColor: '#E2E8F0',
    },
    backButton: {
        padding: 5,
        marginRight: 15,
    },
    headerTitle: {
        fontSize: 18,
        fontWeight: 'bold',
        color: '#1E293B',
        flex: 1,
    },
    content: {
        padding: 20,
    },
    infoCard: {
        flexDirection: 'row',
        backgroundColor: '#EFF6FF',
        padding: 15,
        borderRadius: 12,
        marginBottom: 25,
        borderWidth: 1,
        borderColor: '#DBEAFE',
        alignItems: 'center',
        gap: 10,
    },
    infoText: {
        flex: 1,
        color: '#1E40AF',
        fontSize: 14,
        lineHeight: 20,
    },
    formGroup: {
        marginBottom: 20,
    },
    label: {
        fontSize: 14,
        fontWeight: '600',
        color: '#475569',
        marginBottom: 8,
    },
    required: {
        color: '#EF4444',
    },
    input: {
        backgroundColor: '#FFFFFF',
        borderWidth: 1,
        borderColor: '#CBD5E1',
        borderRadius: 10,
        padding: 12,
        fontSize: 16,
        color: '#334155',
    },
    textArea: {
        height: 100,
    },
    submitButton: {
        backgroundColor: '#2563EB',
        padding: 16,
        borderRadius: 12,
        alignItems: 'center',
        marginTop: 10,
        shadowColor: "#2563EB",
        shadowOffset: { width: 0, height: 4 },
        shadowOpacity: 0.2,
        shadowRadius: 8,
        elevation: 4,
    },
    disabledButton: {
        backgroundColor: '#94A3B8',
    },
    submitButtonText: {
        color: '#FFFFFF',
        fontWeight: 'bold',
        fontSize: 16,
    },
});
